import Register from "../containers/Register";

import Login from "../containers/login";

const routes= [

    {
        path: "/auth/login",
        component: Login,
        title:'login'
    },

    {
        path: "/auth/register",
        component: Register,
        title:'register'
    },

    {
        path: "/",
        component: Home,
        title:'home'
    },
];

export default routes;
